import React from 'react';

function Testimonial(props) {
    return (
        <section>
            <img src={props.img} alt="avatar"/>
            <p>{props.testimonial}</p>
            <p>{props.name}</p>
            <p>{props.role}</p>
        </section>
    )
}

export default Testimonial;
